import { React } from "react";

import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export default function QuestionDetails({ image }) {
  return (
    <Box
      sx={{
        display: 'flex',
        flexDirection: 'column',
      }}
    >
      <img
        src={image}
        alt="question 1"
        width="100%"
      />
    </Box>
  )
}
